INSERT INTO `db_view` VALUES (2,'survey','qBusStops','question','How many bus stops do you want in your suburb (Please select the range)?'),(3,'survey','qBusStops','explanation','Many regional areas on Victoria do not have local train networks. Hence, buses are the main commuting option.'),(4,'survey','qBusStops','hint','Hint! In average, there are 5/suburb bus stops in regional victoria.'),(7,'survey','qHospitals','question','How many hospitals would you like in your area (Please select the range)?'),(8,'survey','qHospitals','header','Hospitals'),(9,'survey','qHospitals','hint','Hint: The average number of hospitals in is 0.056/suburb.'),(11,'survey','qCrimeRate','header','Crime Rate'),(12,'survey','qCrimeRate','question','Please select the range (cases/100 residents) of the crime rate in the area.'),(13,'survey','qCrimeRate','explanation','Crime rates vary widely in different regional areas of Victoria. Choosing a suburb\nwith a low crime rate can make your life more stable and secure.'),(14,'survey','qCrimeRate','hint','The average crime reported in regional Victoria is 5.2 cases per 100 residents'),(15,'survey','qHospitals','explanation','Over 142 private and public hospitals evenly distributed in the regional areas of\nVictoria. Finding a suburb with the right number of hospitals will make your life\neasier and more responsive to unexpected situations.'),(17,'survey','qRealStateRent','header','Rent Prices'),(18,'survey','qRealStateRent','question','What is the budget for your rental home?'),(19,'survey','qRealStateRent','explanation','The housing rent price varies in different suburbs of regional Victoria. Finding a\nhome that fits your budget to rent can help you live a better life.'),(20,'survey','qRealStateRent','hint','Hint: The average weekly rent price in different suburbs is $320/Unit'),(21,'survey','qTrainStops','header','Train stations'),(22,'survey','qTrainStops','question','How many train stops do you want in your suburb (Please select the range)?'),